import React from 'react';
import BoatModelViewer from './BoatModelViewer';
import './MainContent.css';
import GrandSturdy from '../img/GrandSturdy.png';

function MainContent() {
  return (
    <div className="main-content">
      
      {/* Left Panel */}
      <div className="left-panel">
        
        {/* Info + 3D Section */}
        <div className="info-3d-container">
          
          {/* Boat Information (Right Side) */}
          <div className="boat-info">
            <h2>Grand Sturdy 30.0 AC</h2>
            <p>9.70 x 3.35 x 1.00 m</p>
            <p>4 (+2) beds</p>
            <p>December 2024</p>
          </div>
          
          {/* Boat Image (Left Side) */}
          <div className="boat-image">
            <img src={GrandSturdy} alt="Grand Sturdy Boat" />
          </div>

        </div>

        {/* 3D Viewer Section (Below Info and Image) */}
        <div className="three-d-visualization">
          {/* Placeholder for 3D viewer component */}
          {/* Uncomment the line below to include actual 3D viewer component */}
          {/* <BoatModelViewer /> */}
          <p>3D Model Viewer Placeholder</p>
        </div>

        {/* Report Download Section */}
        <div className="pdf-report">
          <h3>Download Report</h3>
          <a href="src/reports/Report_GS30AC_12-2024.pdf" download>Download Report</a>
        </div>

      </div>

      {/* Right Panel */}
      <div className="right-panel">
        {/* Grey Rectangle Placeholder */}
        <div className="right-panel-placeholder">
          {/* Placeholder content for right panel */}
          <p>Right Panel Placeholder</p>
        </div>
      </div>

    </div>
  );
}

export default MainContent;
